  def test_SBase_hasValidLevelVersionNamespaceCombination(self):
    species = libsbml.Species(3,1)
    self.assertTrue( species.hasValidLevelVersionNamespaceCombination() == True )
    species = None
    invalidNamespaces = libsbml.XMLNamespaces()
    species = libsbml.Species(3,1)
    species.setNamespaces(invalidNamespaces)
    invalidNamespaces.add(libsbml.SBMLNamespaces.getSBMLNamespaceURI(2,3), "sbml23")
    species.setNamespaces(invalidNamespaces)
    self.assertTrue( species.hasValidLevelVersionNamespaceCombination() == False )
    invalidNamespaces.add(libsbml.SBMLNamespaces.getSBMLNamespaceURI(3,1), "sbml31")
    species.setNamespaces(invalidNamespaces)
    self.assertTrue( species.hasValidLevelVersionNamespaceCombination() == False )
    invalidNamespaces.clear()
    invalidNamespaces.add(libsbml.SBMLNamespaces.getSBMLNamespaceURI(3,1), "sbml31")
    species.setNamespaces(invalidNamespaces)
    self.assertTrue( species.hasValidLevelVersionNamespaceCombination() == True )
    species = None
    pass  

  def test_SBase_matchesRequiredSBMLNamespacesForAddition(self):
    sbmlns1 = libsbml.SBMLNamespaces( 3,1 )
    sbmlns2 = libsbml.SBMLNamespaces( 2,4 )
    s = libsbml.Species( sbmlns1 )
    p = libsbml.Parameter( sbmlns1 )
    self.assertTrue( s.matchesRequiredSBMLNamespacesForAddition(p) == True )
    self.assertTrue( p.matchesRequiredSBMLNamespacesForAddition(s) == True )
    p = sbmlns2
    self.assertTrue( s.matchesRequiredSBMLNamespacesForAddition(p) == False )
    self.assertTrue( p.matchesRequiredSBMLNamespacesForAddition(s) == False )
    sbmlns1.addNamespace("http:foo", "bar")
    c = libsbml.Compartment( sbmlns1 )
    self.assertTrue( s.matchesRequiredSBMLNamespacesForAddition(c) == True )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(s) == True )
    self.assertTrue( p.matchesRequiredSBMLNamespacesForAddition(c) == False )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(p) == False )
    sbmlns1.addNamespace("http://www.sbml.org/sbml/level3/version1/qual/version1", "bar1")
    s = sbmlns1
    self.assertTrue( s.matchesRequiredSBMLNamespacesForAddition(c) == True )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(s) == False )
    sbmlns3 = libsbml.SBMLNamespaces( 3,1 )
    sbmlns3.addNamespace("http://www.sbml.org/sbml/level3/version1/qual/version1", "bar1")
    c = sbmlns3
    self.assertTrue( s.matchesRequiredSBMLNamespacesForAddition(c) == True )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(s) == True )
    sbmlns4 = libsbml.SBMLNamespaces( 3,1 )
    p = sbmlns4
    self.assertTrue( p.matchesRequiredSBMLNamespacesForAddition(c) == False )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(p) == True )
    sbmlns4.addNamespace("http://www.sbml.org/sbml/level3/version1/qual/version2", "bar2")
    p = sbmlns4
    self.assertTrue( p.matchesRequiredSBMLNamespacesForAddition(c) == False )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(p) == False )
    sbmlns5 = libsbml.SBMLNamespaces( 3,1 )
    sbmlns5.addNamespace("http://www.sbml.org/sbml/level3/version1/qual/version1", "bar1")
    sbmlns5.removeNamespace(libsbml.SBMLNamespaces.getSBMLNamespaceURI(3,1))
    p = sbmlns5
    self.assertTrue( p.matchesRequiredSBMLNamespacesForAddition(c) == False )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(p) == False )
    sbmlns6 = libsbml.SBMLNamespaces( 3,1 )
    sbmlns6.addNamespace("http://www.sbml.org/sbml/level3/version1/qual/version1", "bar1")
    sbmlns6.addNamespace("http://www.sbml.org/sbml/level3/version1/comp/version1", "comp")
    p = sbmlns6
    self.assertTrue( p.matchesRequiredSBMLNamespacesForAddition(c) == True )
    self.assertTrue( c.matchesRequiredSBMLNamespacesForAddition(p) == False )
    pass  

